ads.description:
Dzień dobrym, mam do sprzedania samochód osobowy marki Vauxgall Insignia (brytyjski odpowiednik europejskiego Opla Insignia) wyprodukowany w 2010 roku, który został wyposażony w silnik benzynowy o pojemności 1796 cm3, legitymujący się mocą 125 KM, który pokonał do tej pory 221000 km. Samochód pod względem mechanicznym w dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów pracuje bez zarzutu, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Insignia prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się dobrze, jest do przeprania.

Insignia jest wyposażenia w:

- Klimatyzacje;

- Elektryczne szyby przednie;

- Elektrycznie regulowane i podgrzewane lusterka;

- ABS z ESP;

- Centralny zamek;

- 4 x airbag;

- Oryginalne radio CD;

I wiele innych rzeczy o których zapomniałem wspomnieć.

Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.

Dowód V5, możliwość rejestracji, brak opłat.
